import { makeStyles } from '@material-ui/core/styles';

export const useStyles = makeStyles(() => ({
    workExperienceHeading: {
        marginTop: 32,
        fontWeight: 'bold'
    },
    cardMediaStyle: {
        maxHeight: 250,
        height: '80%'
    },
    boldText: {
        fontWeight: 'bold'
    },
    marginTopTwo: {
        marginTop: 2,
    },
    marginTopEight: {
        marginTop: 8,
    },
    marginTopSixteen: {
        marginTop: 16
    },
    marginLeftEight: {
        marginLeft: 8
    },
}));
